import React from 'react';
import { useNavigate } from 'react-router-dom';
import '.=/NossaFrota.css'; // Certifique-se de criar e ajustar os estilos conforme desejado

function NossaFrota() {
  const navigate = useNavigate();

  const onibusData = [
    { id: 2019, imagem: require('../assets/azul-2019.png'), descricao: "Lorem ipsum dolor sit amet, consectetur adipiscing elit." },
    { id: 2611, imagem: require('../assets/laranja-2611.png'), descricao: "Sed do eiusmod tempor incididunt ut labore et dolore magna aliqua." },
    { id: 2018, imagem: require('../assets/g8-2018.png'), descricao: "Ut enim ad minim veniam, quis nostrud exercitation ullamco laboris." },
    { id: 1203, imagem: require('../assets/cinza-1203.png'), descricao: "Lorem ipsum dolor sit amet, consectetur adipiscing elit." },
    { id: 1506, imagem: require('../assets/verde-1506.png'), descricao: "Duis aute irure dolor in reprehenderit in voluptate velit esse cillum." },
  ];

  const handleVejaMais = () => {
    navigate('/contato');
  };

  return (
    <div className="nossa-frota">
      <h1>Nossa Frota</h1>
      <div className="frota-container">
        {onibusData.map((onibus) => (
          <div key={onibus.id} className="frota-item">
            <img src={onibus.imagem} alt={`Ônibus ${onibus.id}`} className="frota-image" />
            <div className="frota-info">
              <h2>Ônibus {onibus.id}</h2>
              <p>{onibus.descricao}</p>
              <button onClick={handleVejaMais} className="btn-veja-mais">Veja Mais</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default NossaFrota;
